
public class Cantantes {

	private String nombreCantante, apellidoCantante, DNIcantante, fechaNac, nombreArtistico;

	public Cantantes() {
		super();
		// TODO Auto-generated constructor stub
	}

	public String getNombreCantante() {
		return nombreCantante;
	}

	public void setNombreCantante(String nombreCantante) {
		this.nombreCantante = nombreCantante;
	}

	public String getApellidoCantante() {
		return apellidoCantante;
	}

	public void setApellidoCantante(String apellidoCantante) {
		this.apellidoCantante = apellidoCantante;
	}

	public String getDNIcantante() {
		return DNIcantante;
	}

	public void setDNIcantante(String dNIcantante) {
		DNIcantante = dNIcantante;
	}

	public String getFechaNac() {
		return fechaNac;
	}

	public void setFechaNac(String fechaNac) {
		this.fechaNac = fechaNac;
	}

	public String getNombreArtistico() {
		return nombreArtistico;
	}

	public void setNombreArtistico(String nombreArtistico) {
		this.nombreArtistico = nombreArtistico;
	}

}
